import React from 'react'
import ContentHeader from '../../components/admin/layouts/ContentHeader';
import Dashboard from '../../components/admin/pages/Dashboard';

export default class index extends Component {
  componentDidMount() {
    const chart = document.createElement('script')
    chart.src = 'plugins/chartjs-old/Chart.min.js'
    chart.async = true
    document.body.appendChild(chart)

    const dashboard2 = document.createElement('script')
    dashboard2.src = 'dist/js/pages/dashboard2.js'
    dashboard2.async = true
    document.body.appendChild(dashboard2)
  }

  render() {
    return (
      <div>
        <ContentHeader header={'Dashboard'} />
        <Dashboard />
      </div>  
    )
  }
}
